* {margin: 0; padding: 0;}
li {list-style: none;}
a {color: black; text-decoration: none;}
img {display: block;}


* {font-family: 'Spoqa Han Sans Neo', sans-serif;}

body, html {
  cursor: url(./images/mouse_cursor_line.png), auto;
  background-image: url(./images/shadow.jpg);
  background-size: cover;
  background-position: center;
  background-attachment: fixed; 
}

@font-face {
  font-family: 'GangwonEduSaeeum_OTFMediumA';
  src: url('https://cdn.jsdelivr.net/gh/projectnoonnu/noonfonts_2201-2@1.0/GangwonEduSaeeum_OTFMediumA.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}


/*---------page label------------*/

.menu {
  position:fixed;
  top:0;
  right: 0;
  height: 40px;
  z-index: 15;
  width: 800px;
  padding: 0;
  margin:0;
}
.menu li {
  display:inline-block;
  margin: 10px;
  color: black;
  background:white;
  background: rgba(255, 255, 255, 0.5);
  border-radius: 10px;
  box-shadow: -2px 5px 5px rgba(0, 0, 0, 0.2);
}
.menu li:hover {
  background: rgba(255, 255, 255, 0.8);
}
.menu li.active {
  background:#666;
  background: rgba(0, 0, 0, 0.5);
  color: white;
}

.menu li a {
  text-decoration:none;
  color: black;
}
.menu li.active a:hover {
  color: black;
}

.menu li a,
.menu li.active a {
  padding: 9px 18px;
  display:block;
}
.menu li.active a {
  color: white;
}


.info {
  position: fixed;
  top: 0;
  left: 270px;
  width: 250px;
  height: 40px;
  z-index: 15;
}
.info li {
  display:inline-block;
  margin: 10px;
  color: black;
  background: rgba(255, 255, 255, 0.5);
  border-radius: 10px;
  box-shadow: -2px 5px 5px rgba(0, 0, 0, 0.2);
}
.info li a:hover {
  background: rgba(0, 0, 0, 0.5);
  color: #eee;
}
.info li a {
  padding: 5px 11px;
  display:block;
  font-size: 20px;
  border-radius: 10px;
}





/*---------full page------------*/

.fullpage section {
  background-color: transparent;
}


.fullpage-wrapper {
	width: 100%!important;
	transform: none!important;
}
.fp-section {
  width: 100%!important;
  position: absolute;
  left: 0;
  top: 0;
  visibility: hidden;
  opacity: 0;
  z-index: 0;
  transition: all 0.5s ease-in-out;
}
.fp-section.active {
  visibility: visible;
  opacity: 1;
  z-index: 1;
}

.fp-prev, .fp-next {display: none;}





/*---------display----------*/
.fullpage section .display {
  display: flex;
  flex-wrap: wrap;
  width: 1300px;
  height: 700px;
  background-color: white;
  border-radius: 10px;
  box-shadow: 2px 15px 20px 10px rgba(0, 0, 0, 0.3);
  margin: auto;
}
.fullpage section .display .top {
  width: 1300px;
  height: 35px;
  background-color: #d6d6d6;
  border: 1px solid #999;
  border-radius: 10px 10px 0 0;
  box-sizing: border-box;
  background-image: linear-gradient(to top, rgba(0,0,0,0.1), transparent);
}
.fullpage section .display .top {
  display: flex;
  line-height: 35px;
}
.fullpage section .display .top>div {
  display: flex;
  margin-left: 5px;
}
.fullpage section .display .top>div .btn {
  width: 15px;
  height: 15px;
  border-radius: 20px;
  margin: auto 3px;
}
.fullpage section .display .top>p {
  margin: auto;
}
.fullpage section .display .top .red_btn {
  background-color: #FC4747;
  border: 1px solid #D84E51;
}
.fullpage section .display .top .yellow_btn {
  background-color: #FDB024;
  border: 1px solid #D78F1D;
}
.fullpage section .display .top .green_btn {
  background-color: #29C432;
  border: 1px solid #1BA124;
}

.fullpage section .display .left {
  width: 411px;
  height: 665px;
  background-color: #eee;
  border: 1px solid #999;
  border-radius: 0 0 0 10px;
  border-top: none;
  box-sizing: border-box;
  background-image: linear-gradient(to top, rgba(0,0,0,0.1), transparent);
}






/*-------page00--------*/

.fullpage .page00 {
  background-image: url(./images/half_image.gif);
  background-size: cover;
  background-position: center;
  background-repeat: no-repeat;
}

.fullpage .page00 .back_black {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 100vh;
  background-color: rgba(0, 0, 0, 0.5);
  position: absolute;
  top: 0;
}
.fullpage .page00 .back_black .enter {
  display: flex;
  justify-content: center;
  width: 1100px;
  height: 320px;
}
.fullpage .page00 .back_black .enter .text_box {
  text-align: left;
  width: 600px;
  height: 100px;
  color: white;
  font-size: 40px;
  font-weight: bold;
  margin-top: 50px;
}
.fullpage .page00 .back_black .enter .text_box .text {
  text-shadow: 0px 3px 5px rgba(0, 0, 0, 0.5);
}
.fullpage .page00 .back_black .enter .text_box .blink {
  animation: blink 0.5s infinite;
  font-size: 40px;
}
@keyframes blink {
  to {
    opacity: 0;
  }
}






