}
.fullpage .page01 .slide:nth-child(2) .display .left>div:first-child>div:last-child>p.in {
  display: inline-block;
  border-radius: 7px;
  background: rgba(0, 0, 0, 0.1);
}


.fullpage .page01 .slide:nth-child(2) .display .right {
  width: 889px;
  height: 665px;
}
.fullpage .page01 .slide:nth-child(2) .display .right>div:first-child {
  display: flex;
  justify-content: space-evenly;
