}
.fullpage .page01 .slide:nth-child(2) .display .right>div:last-child .career .right>div {
  margin-top: 5px;
}
.fullpage .page01 .slide:nth-child(2) .display .right>div:last-child .education .right>div>div:first-child,
.fullpage .page01 .slide:nth-child(2) .display .right>div:last-child .career .right>div>div:first-child,
