}
.fullpage .page03 .left .swiper-container .swiper-pagination .swiper-pagination-bullet-active {
  background-color: rgba(255, 255, 255, 0.5);
  box-shadow: inset 0px -2px 5px 2px rgb(0, 0, 0, 0.1);
}
.fullpage .page03 .left .swiper-container .swiper-pagination .swiper-pagination-bullet>span {
  background-image: url(./images/folder.png);
  background-size: auto;
  background-repeat: no-repeat;
  padding-left: 50px;
}


.fullpage .page03 .left .swiper-container .swiper-wrapper .swiper-slide {
